$("#logout").on("click",function(){Swal.fire({title:"Are you sure?",text:"Apakah Anda Ingin Keluar Dari Sistem ?",icon:"warning",showCancelButton:!0,confirmButtonColor:"#3085d6",cancelButtonColor:"#d33",confirmButtonText:"Ya",cancelButtonText:"Tidak"}).then(o=>{o.value&&(window.location="/logout")})});